import React from "react";
import { useState } from 'react';
import '../css/bookSearch.css';

const [values, setValues] = useState({
    name: ''
});

const SearchInput = () =>{
    return(
        <div className="topmain">
            <div>
                <p>BOOK SEARCH</p>
                <br/>
                <input type="text" name="searchword" size="50"  placeholder="キーワード検索"/>
                <button onClick={handleSubmit} type="submit">検索</button>
            </div>
        </div>
    );

};

export default SearchInput;
